A function construct in C is used to write code that solves a (small) problem. A procedural C program is made up of one or more functions, one of them being main(). A C program will always begin execution with main(). Function parameters can be passed into a function in one of two ways; pass by value and pass by reference. When a parameter is passed in via value, the data for the parameters are copied. This means any changes to said variables within the function will not affect the original values passed in. Pass by reference on the other hand passes in the memory address of each variable into the function. This means that changes to the variables within the function will affect the original variables. Example 1: Function control #include <stdio.h> void prn_message(const int k); int main(void) { int n; printf("There is a message for you.
"); printf("How many times do you want to see it?
"); scanf("%d", &n); prn_message(n); return 0;
