"); for (size_t i = 0; i < k; i++) { printf("Have a nice day!
"); }
} Example 2: Pass by values #include <stdio.h> void swapx(int a, int b); int main(void) { int a = 10; int b = 20; // Pass by value swapx(a, b); printf("within caller - a: %d, b: %b
", a, b); // "within caller - a: 10, b: 20" return 0;
} void swapx(int a, int b) { int temp; temp = a; a = b; b = temp; printf("within function - a: %d, b: %b
