Heap memory is memory that is allocated during the runtime of the program. On many systems, the heap is allocated in an opposite direction to the stack and grows towards the stack as more is allocated. On simple systems without memory protection, this can cause the heap and stack to collide if too much memory is allocated to either one. To deal with this, C provides two functions in the standard library to handle dynamic memory allocation; calloc() (contiguous allocation) and malloc() (memory allocation). void *calloc(size_t n, size_t s) returns a pointer to enough space in memory to store n objects, each of s bytes. The storage set aside is automatically initialised to zero. void *malloc(size_t s) returns a pointer to a space of size s and leaves the memory uninitialised. Example 3: malloc() and calloc() #include <stdio.h>
#include <stdlib.h> int main() { int num_of_elements; int *ptr; int sum = 0; printf("Enter number of elements: "); scanf("%d", &num_of_elements); ptr = malloc(num_of_elements * sizeof(int)); // or // ptr = calloc(num_of_elements, sizeof(int)); if (ptr == NULL) { printf("[Error] - Memory was unable to be allocated."); exit(0); } printf("Enter elements: "); for (int i = 0; i < n; i++) { scanf("%d", ptr + i); sum += *(ptr + i); } printf("Sum = %d", sum); free(ptr); return 0;
}
